- input: "TEXT\x1CC00313510\x1CX0\x1C\x1CF3A\x1CThis amendment is filed in response
    to the FEC letter dated January 13, 2009.  Pursuant to my conversation with Finance
    Analyst Amanda Iovino this report is amended in the following ways.     1.) In
    reference to itemized contributions on Schedule A of this report, the Election
    Cycle to Date figures for Parsons Brinckerhoff PAC have been modified.  On this
    report the records of Parsons PAC (FEC Committee ID# C00103549) were mistakenly
    merged with Parsons Brinkerhoff, Inc. PAC. (FEC Committee ID# C00287003)  The
    two aforesaid records have been separated in accordance with our contribution
    histories for each and the aggregate contribution totals are accurately reflective
    of their respective amounts contributed for the reporting period.     2.) In respect
    to contributions received by John Mele there are in fact two distinct individuals
    who contributed to our campaign.  Contributions received on 6/7/2007, 12/10/2007,
    and 10/20/2008 are from John J. Mele.  The contribution received on 3/8/2007 was
    from John A. Mele.  The aggregate totals for both individuals are correctly reflected
    in this report.    3.) The law firm of Lum, Danzis, Drasco, Positan & Kleinberg
    contributed to our campaign as well as the law firm of Lum, Drasco, Positan.  The
    latter is the remainder of the same firm after a reorganization of the partnership.
    \ As per our guidance from the FEC the two records were merged for sake of this
    report and any newly reorganized contributions from the current firm will be reported
    as received from the present entity of Lum, Drasco, & Positan LLC beginning in
    the 2009 - 2010 cycle.    All aggregate totals fall within the applicable contribution
    limits, and if derived from a partnership are appropriately designated to the
    legitimate partner prescribed to receive credit for the contribution.  No cash
    on hand, disbursement, or receipt totals have changed as a result of the amendments
    made. "
